import React, { Component } from 'react'
import { connect } from 'react-redux'
import { Link } from 'react-router-dom';
import NavBar from './NavBar';


class Leader extends Component {
    render() {

        return (
            <div>
                <NavBar />
            </div>
        )
    }


}
const mapStateToProps = (state) => {
    console.log("state to login component", state.login);
    if (state.login !== undefined) {
        let questionsScore = [];
        let answersScore = [];
        for (const user in state.login.users) {
            console.log("the state after modification", user, state.login.users[user].questions.length);
            console.log("the state after modification", user, Object.keys(state.login.users[user].answers).length);
        }
        //   console.log("the state after modification", state);
    }
    return {
        users: state.login.users,

        //   images: Object.keys(state.login.users.avatarURL)
    }
}
export default connect(mapStateToProps)(Leader)
